import './App.css';
import EventsUpload from './components/EventsUpload';
import SidebarMenu from 'react-bootstrap-sidebar-menu';
import SideNav from './components/SideNav';
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <>
    <SideNav/>
    <BrowserRouter>
    <Routes>
      <Route path='/hero'/>
    </Routes>
    </BrowserRouter>
    </>

  );
}

export default App;
